webpackJsonp([26668243863101],{409:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Laura Domine",subtitle:"Physics Ph.D. student",copyright:"Powered by Gatsby. © All rights reserved.",author:{name:"Laura Domine",twitter:"#"}}},markdownRemark:{id:"/home/mai-hien/hummingbird2/src/pages/projects/whisper-app/index.md absPath of file >>> MarkdownRemark",html:'<h2>Whisper App: Rumour source detection</h2>\n<p><em>Sep. 2015 - June 2016. Under the supervision of <a href="http://pages.saclay.inria.fr/laurent.massoulie/index.htm">Laurent Massoulié</a>. With Mickaël Latocca, Rémi Said, Louis Lallemand, Quentin Bertrand, Henri Bourdeau, Carolina Garcia.</em></p>\n<p>Finding the source of an epidemics can be crucial in many ways: cascading failures and the resulting black-outs are critical for energy distribution networks, virus epidemics that wreak havoc but could be neutralized faster if only we understood where it came from, fake informations spreading on social networks that can have serious consequences for financial markets… Around 2010 some researchers started looking into algorithms to automatically detect the origin of an epidemics given the contaminated graph (or part of it).</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/graph1-2d8e31f310dccd55ea659dd99ce1b37e-f96c0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 240px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 132.08333333333334%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Whisper App"\n        title=""\n        src="/static/graph1-2d8e31f310dccd55ea659dd99ce1b37e-f96c0.png"\n        srcset="/static/graph1-2d8e31f310dccd55ea659dd99ce1b37e-f96c0.png 240w"\n        sizes="(max-width: 240px) 100vw, 240px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I led a team of 6 students at Ecole polytechnique to investigate these rumour source detection algorithms. We designed several algorithms of our own and built a web interface (Whisper App) to allow the interactive execution of algorithms from the literature in addition to ours.</p>\n<p><a href="http://temigo.pythonanywhere.com/#/">Try Whisper App online!</a> /\n<a href="https://github.com/Temigo/whisper-app">Back-end code</a> /\n<a href="https://github.com/Temigo/whisper-app-client">Front-end code</a> /\n<a href="https://github.com/Temigo/whisper">Algorithms implementations</a></p>',fields:{tagSlugs:null},frontmatter:{title:"Whisper App",tags:null,date:"2016-06-10",description:"Finding the source of an epidemics can be crucial. I led a team of 6 students at Ecole polytechnique to investigate rumour source detection algorithms."}}},pathContext:{slug:"/projects/whisper-app"}}}});
